(def SHIFT
  (merge
    {\-     \space
     \space \space}
    (zipmap
      u/letters
      (->> u/letters (cycle) (rest)))))

(defn decrypt [m]
  (assoc m :name (->> (:name m)
                   (iterate (partial map SHIFT))
                   (drop (:sector m))
                   (first)
                   (str/join))))


(defn parse-line [s]
  (let [m (->> (str/replace s "-" "")
            (re-matches #"([a-z]+)(\d+)\[(\w+)\]")
            (rest)
            (zipmap [:letters :sector :checksum]))
        room-name (->> m :sector (str "-") (re-pattern) (str/split s) (first))]
    (-> m
      (update :sector edn/read-string)
      (assoc :name room-name))))

(defn parse-input [s]
  (->> s
    (str/split-lines)
    (map parse-line)))

(defn freq-comparator [[x x-freq] [y y-freq]]
  (compare
    [y-freq x]
    [x-freq y]))

(defn real-room? [{:as m :keys [:letters :checksum]}]
  (->> letters
    frequencies
    (sort freq-comparator)
    (take 5)
    (map key)
    (apply str)
    (= checksum)))

(def real-rooms (->> input parse-input (filter real-room?)))

(def r1 (->> real-rooms (map :sector) (reduce +)))
(def r2 (->> real-rooms
          (map decrypt)
          (filter #(-> % :name (= "northpole object storage")))
          (first)
          :sector))

(assert (= r1 278221))
(assert (= r2 267))

(assert (true? (real-room? (parse-line "aaaaa-bbb-z-y-x-123[abxyz]"))))
(assert (true? (real-room? (parse-line "a-b-c-d-e-f-g-h-987[abcde]"))))
(assert (true? (real-room? (parse-line "not-a-real-room-404[oarel]"))))
(assert (false? (real-room? (parse-line "totally-real-room-200[decoy]"))))

